import React from 'react';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import { COLUMN_HEADERS } from 'shared/constants/stringConstantsSelectors';

export const TableHeaders = props => {

    const { columnDefinitions } = props;

    const headerColumn = columnDefinitions.map((record, i) => (
        <TableCell>{record.headerName}</TableCell>
    ))

    return (
        <TableHead>
            <TableRow>
                {headerColumn}
                {/* <TableCell>{COLUMN_HEADERS.SYMBOL}</TableCell>
                <TableCell>{COLUMN_HEADERS.PRICE_OPEN}</TableCell>
                <TableCell>{COLUMN_HEADERS.YESTERDAY_CLOSE}</TableCell>
                <TableCell>{COLUMN_HEADERS.DAY_HIGH}</TableCell>
                <TableCell>{COLUMN_HEADERS.DAY_LOW}</TableCell>
                <TableCell>{COLUMN_HEADERS.VOLUME}</TableCell> */}
            </TableRow>
        </TableHead>
    );
};
